import React, { useState } from 'react';
import { Link, useNavigate } from "react-router-dom";
import axios from 'axios';

function First() {
    const [team, setTeam] = useState('');
    const [dateFirst, setDateFirst] = useState('');
    const navigate = useNavigate();

    const handleSubmit = () => {
        axios.post('http://localhost:8070/router/add', {
            team,
            date: dateFirst,
            Operatorname: '', // add necessary fields
            Operatorgrade: '',
            Operationname: '',
            Operationgrade: '',
            value: 0,
            pieces: 0
        })
        .then(response => {
            console.log(response.data);
            navigate('/Second');
        })
        .catch(error => {
            console.error('There was an error!', error);
        });
    };

    return (
        <div>
            <label>Team</label>
            <input type="text" name="team" value={team} onChange={(e) => setTeam(e.target.value)} /> <br/>
            
            <label>Date</label>
            <input type="date" name="dateFirst" value={dateFirst} onChange={(e) => setDateFirst(e.target.value)} /> <br/>

            <button type="button" onClick={handleSubmit}>Start</button> <br/>
            <Link to='/Third'> <input type="submit" name="searchsubmit" value="Search"/></Link>
        </div>
    );
}

export default First;
